import React from 'react'

const App = (props) => {
  const { notes } = props

  const arr= notes.map(note => 
    <li key={note.id}>
      {note.content}
    </li>
  )
  return (
    <div>
      <h1>Notes</h1>
      <ul>
        {arr}
      </ul>
    </div>
  )
}

export default App
